import { FC } from "react"
import { Card } from "../Card";
import { Item } from "../../types/Item";

type Props = {
  items: Item[];
}

export const Catalog: FC<Props> = ({ items }) => {
  return (
    <>
      <Search setItems={setItems} data={items} /><div className="cards">
        {items.map(item => {
          return (
            <Card key={item.code} item={item} />
          );
        })}
      </div>
    </>
  )
}
